function initializeGUI(){fetch("/api/user/data",{method:"GET"}).then(t=>{if(t.ok)return t.json();throw 401===t.status&&alert("An error occured when attempting to login"),new Error("HTTP error! status: "+t.status)}).then(t=>{!0===t.tokenVerified&&(window.location.href="/")}).catch(t=>{})}export{initializeGUI};